import Login from "./Components/Login page/login";
import Interface from "./Components/NavBar/nav";
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Login></Login>
      <Routes>
        <Route path="/interface">
          <Interface></Interface>
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
